import React, { useEffect, useState } from "react";
import signalRService from "../services/signalRService";

const TerminalComponent = () => {
  const [legs, setLegs] = useState([]);

  useEffect(() => {
    const startSignalRConnection = async () => {
      await signalRService.startConnection();

      // Handle flightReceived event
      signalRService.addFlightReceivedListener((flight) => {
        console.log("Received flight:", flight);
        updateLeg(flight.currentLeg, flight.flightNumber);
      });

      // Handle flightRemove event
      signalRService.addFlightRemoveListener((flightId) => {
        console.log("Removed flight:", flightId);
        removeFlight(flightId);
      });

      // Handle flightMove event
      signalRService.addFlightMoveListener((flightId, updatedLeg) => {
        console.log(`Moved flight: ${flightId} - ${updatedLeg}`);
        moveFlight(flightId, updatedLeg);
      });
    };

    startSignalRConnection();
  }, []);

  const initializeLegs = () => {
    const initialLegs = [];
    for (let i = 1; i <= 9; i++) {
      initialLegs.push({ legNumber: i, flightNumbers: [] });
    }
    setLegs(initialLegs);
  };

  const updateLeg = (legNumber, flightNumber) => {
    setLegs((prevLegs) =>
      prevLegs.map((leg) =>
        leg.legNumber === legNumber ? { ...leg, flightNumbers: [...leg.flightNumbers, flightNumber] } : leg
      )
    );
  };

  const moveFlight = (flightId, updatedLeg) => {
    setLegs((prevLegs) =>
      prevLegs.map((leg) =>
        leg.flightNumbers.includes(flightId)
          ? { ...leg, flightNumbers: leg.flightNumbers.filter((flight) => flight !== flightId) }
          : leg
      )
    );
    updateLeg(updatedLeg, flightId);
  };

  const removeFlight = (flightId) => {
    setLegs((prevLegs) =>
      prevLegs.map((leg) =>
        leg.flightNumbers.includes(flightId)
          ? { ...leg, flightNumbers: leg.flightNumbers.filter((flight) => flight !== flightId) }
          : leg
      )
    );
  };

  useEffect(() => {
    initializeLegs();
  }, []);

  return (
    <div className="terminal">
      <div className="line">
        <div className="leg leg-1">
          <h2>Leg 1</h2>
          {legs[0]?.flightNumbers?.length > 0 ? (
            legs[0].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
        <div className="arrow arrow-right" />
        <div className="leg leg-2">
          <h2>Leg 2</h2>
          {legs[1].flightNumbers.length > 0 ? (
            legs[1].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
        <div className="arrow arrow-right" />
        <div className="leg leg-3">
          <h2>Leg 3</h2>
          {legs[2].flightNumbers.length > 0 ? (
            legs[2].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
        <div className="arrow arrow-right" />
        <div className="leg leg-4">
          <h2>Leg 4</h2>
          {legs[3].flightNumbers.length > 0 ? (
            legs[3].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
        <div className="arrow arrow-down" />
        <div className="leg leg-9">
          <h2>Leg 9</h2>
          {legs[8].flightNumbers.length > 0 ? (
            legs[8].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
      </div>
      <div className="line">
        <div className="leg leg-8">
          <h2>Leg 8</h2>
          {legs[7].flightNumbers.length > 0 ? (
            legs[7].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
        <div className="arrow arrow-right" />
        <div className="leg leg-5">
          <h2>Leg 5</h2>
          {legs[4].flightNumbers.length > 0 ? (
            legs[4].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
        <div className="arrow arrow-down" />
      </div>
      <div className="line">
        <div className="leg leg-7">
          <h2>Leg 7</h2>
          {legs[6].flightNumbers.length > 0 ? (
            legs[6].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
        <div className="arrow arrow-right" />
        <div className="leg leg-6">
          <h2>Leg 6</h2>
          {legs[5].flightNumbers.length > 0 ? (
            legs[5].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default TerminalComponent;
